import React from "react";
import { Link } from "@reach/router";

const Header = ({ user }) => {
  console.log(user);
  if (user.password) {
    return (
      <div>
        <nav>
          <ul>
            <Link to="/">Home</Link>
            <Link to="/topics" user={this.state.user}>
              Topics
            </Link>
            <Link to="/socialMediaLinks">SocialMediaLinks</Link>
            <Link to="/chnage_user">Log Out</Link>
          </ul>
        </nav>
        <section>Logged In As: {user.username}</section>
        <header>
          <h1>Logo</h1>
          <h2>Description</h2>
        </header>
      </div>
    );
  }
  return (
    <div>
      <nav>
        <ul>
          <Link to="/">Home</Link>
          <Link to="/topics">Topics</Link>
          <Link to="/socialMediaLinks">SocialMediaLinks</Link>
          <Link to="/sign_up">Sign up</Link>
          <Link to="/log_in">Log in</Link>
        </ul>
      </nav>
      <header>
        <h1>Logo</h1>
        <h2>Description</h2>
      </header>
    </div>
  );
};

export default Header;
